			<h3 class="title">Our Materiality Matrix</h3>
		</div>
		<div class="body-wrapper">
			<div class="desc-info">
				<p>In our materiality assessment, our stakeholders identified the aspects of our business that have the greatest impact for them. We deepened our analysis on those aspects by providing clear definitions per topic, launching an automated stakeholder feedback survey and conducting informal dialogues with our stakeholders. We aimed to have a better understanding of why our stakeholders considered the topics important and how each stakeholder group perceived the extent of the effects each topic had.</p>
