				<div id="communityInvolvement" class="framework-desc">
          <h5>COMMUNITY INVOLVEMENT <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Community Involvement.png'; ?>" alt=""></h5>
          <p><span>Boundaries:</span> Within SM and host communities</p>
          <p><span>Description:</span> How the Company helps provide access to social services such as education, healthcare, livelihood, shelter and disaster relief support</p>
        </div>
				<div id="customerRights" class="framework-desc">
          <h5>CUSTOMER RIGHTS AND WELFARE <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Customer Rights.png'; ?>" alt=""></h5>
          <p><span>Boundaries: </span> Within SM, customers</p>
          <p><span>Description:</span> How the Company protects the rights of its customers through customer data privacy, customer satisfaction initiatives and customer engagement programs; and ensures the safety of its customers</p>
        </div>
				<div id="economicPerformance" class="framework-desc">
					<h5>Economic Performance <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Economic.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM, host communities, business partners, government, investors</p>
					<p><span>Description:</span> How we deliver sustained returns to our shareholders, create economic value to our stakeholders and contribute to the economic development of the country</p>
				</div>
				<div id="marketPresence" class="framework-desc">
					<h5>Market Presence <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Market.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM, customers, business partners.</p>
					<p><span>Description:</span> How we make the SM brand accessible and inclusive to a broad and diverse market</p>
				</div>
				<div id="inclusiveSupplyChain" class="framework-desc">
					<h5>Inclusive Supply Chain <br/>(MSME Inclusion) <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Inclusive Supply.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM, business partners.</p>
					<p><span>Description:</span> How we provide opportunities for MSMEs to be competitive in organized retailing</p>
				</div>
				<div id="employeeRightsAndWelfare" class="framework-desc right-arrow">
					<h5>Employee Rights and Welfare <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Employee Rights.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM</p>
					<p><span>Description:</span> How we protect the rights, welfare and dignity of our employees through decent working conditions, fair compensation and benefits and employee engagement programs</p>
				</div>
				<div id="employeeTraining" class="framework-desc">
					<h5>Employee Training, Development, <br/>and Career Pathing <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Employee Training.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM</p>
					<p><span>Description:</span> How we develop talents, recognize contribution and achievements and provide long-term professional development</p>
				</div>
				<div id="occupationalHealth" class="framework-desc">
					<h5>Occupational Health and Safety <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Occupational Health .png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM</p>
					<p><span>Description:</span> How we ensure the health and well being of our employees, providing adequate health and insurance benefits</p>
				</div>
				<div id="diversityAndEqual" class="framework-desc right-arrow">
					<h5>Diversity, Equal Opportunities <br/>and Job Creation <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Diversity.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM</p>
					<p><span>Description:</span> How we provide inclusiveness in our manpower selection and employ equal remuneration regardless of gender, race or creed</p>
				</div>
				<div id="sustainableOperations" class="framework-desc right-arrow">
					<h5>Sustainable Operations and Business Continuity <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Sustainable.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM, business partners and host communities</p>
					<p><span>Description:</span> How we efficienly utilize resources and minimize our impact on the environment</p>
				</div>
				<div id="leadershipPolicy" class="framework-desc right-arrow">
					<h5>Leadership, Policy and Due Diligence <img src="<?= get_template_directory_uri().'/assets/images/sustainability/ovcs/materiality/Matrix - Leadership.png'; ?>" alt=""></h5>
					<p><span>Boundaries:</span> Within SM</p>
					<p><span>Description:</span> How we promote good governance in our policies, practices and code of ethics and how we comply with all relevant laws and regulations</p>
